import { Image, TouchableOpacity, View } from "react-native";

import styles from "../styles/homepage";

export const Homepage = ({navigation}) => {
    return(
        <View style={styles.container}>
      <View style={styles.logoContainer}>
    
      <Image source={require('../images/searching-bar.png')} style={styles.logo} />
      </View> 
      <TextInput 
              style={[styles.input, {color: 'white'}]}
              placeholder="Search"
              placeholderTextColor={'white'}
              />




        <View style={styles.container}>
        <View>
        <Image source={require('../images/logo.png')} 
        style={[styles.logo, { tintColor: '#FF003D' }]}
        />
        </View>

        <View style={styles.optionContainer}>
            
        <TouchableOpacity style={styles.optionSelect}
                onPress={() => navigation.navigate('Nutrition')}
                > 
                <Image source={require('../images/food.png')} 
                    style={styles.optionLogo}
                />
                </TouchableOpacity>
                
            

            <TouchableOpacity style={styles.optionSelect}
                onPress={() => navigation.navigate('Exercise')}
                >
                <Image source={require('../images/ee.png')} 
                    style={styles.exerciseLogo}
                />
                </TouchableOpacity>
                
        </View>
        
        </View>
        
    )
</View>)}
